import React, { useState, useEffect } from "react";

function MenuComponent() {
    console.log('Men');

    // Declare state to hold the entire response object
    const [recepieList, recepiefn] = useState(null); // Use null as initial state since it's an object

    // Fetch data when component mounts
    useEffect(() => {
        fetch('/recepiedata.json')
            .then((res) => res.json()) // Convert response to JSON
            .then((res) => {
                console.log('Fetched data:', res);
                recepiefn(res); // Store the entire response object in state
            })
            .catch((err) => console.log(err));
    }, []); // Empty dependency array means this will only run once after the first render

    return (
        <div className="menuparent">
            <span className="font-24">Desserts</span>
            {recepieList && recepieList.items.length > 0 && // Check if recepieList is not null and has items
                recepieList.items.map((val, index) => (
                    <div key={index}>
                        {/* Render each item from the list */}
                        <p>{val.name}</p>
                    </div>
                ))
            }
        </div>
    );
}

export default MenuComponent;
